import React from 'react';
import logoBrainFlix from '../../Assets/Logo/Logo-brainflix.png'



const Header = () => {
    return (
      <header className="header">
        <img src={logoBrainFlix} alt="Logo"/>
        <nav className="header__links header__links--left">
          <a>Home</a> |
          <a>About</a> |
          <a>Contact</a>
        </nav>
        <div className="header__logo">
          {props.logoName}
        </div>
        <div className="header__links header__links--right">
          <input className="search" placeholder="Search..." />
          <p className="lastPressed"></p>
        </div>
      </header>
    );
  }


export default Header;
